/**
 * Please refer to LiveChatAvFactory class definition
 */
export default class LiveChatAvFactoryE6 {
    constructor() {
        this.instance = new LiveChatAvFactory();
    }

    CreateUsingCustom = (comm) => {
        return this.instance.CreateUsingCustom(comm);
    }

    CreateUsingLivechat = () => {
        return this.instance.CreateUsingLivechat();
    }

    CreateUsingLivechat2 = (livechat2Instance) => {
        return this.instance.CreateUsingLivechat2(livechat2Instance);
    }
}

/** 
 * This variable specifies whether to behave as legacy livechat mode. When
 * this variable is not defined or set to true the library will make sure
 * 'Offer' is always generated by this API regardless of side (caller/calee)
 * this API is working as.
 */
var LiveChatAvLegacyModeFlag = false;

/**
 * The error code constants
 */
var LiveChatAvErrorCodes = {
	/**
	 * The required permission not granted by user or required audio/video device is busy or access 
	 * to the device is not granted by the operating system.
	 */
	AUDIO_VIDEO_CAPTURE_ERROR: 1000,

    /**
     * Remote party is off-line.
     */
    CALEE_OFFLINE: 2000,

    /**
     * Remote party did not answer the call even though call was ringing at remote party.
     */
    CALL_NOT_ANSWERED: 2001,

    /**
     * Remote party rejected the incoming call.
     */
    CALL_REJECTED: 2002,

    /**
     * Call hang up by the local party prior to call connect.
     */
    CALL_CANCELED: 2003,

    /**
     * The incoming call was rejected by local party (this event is triggered at the end that 
     * rejected the call).
     */
    CALL_REJECTED_LOCAL: 2004,

	/**
	* A error due to system state or system not supporting a mandatory feature.
	*/
	SYSTEM_ERROR: 1001    
};

var LiveChatAvCallTypes = {
    /**
     * A audio call
     */
    AUDIO: 1,

    /**
     * A video call (has both audio and video)
     */
	VIDEO: 2
}

function LiveChatAvAcceptInterface(instance) {
    var this_ = instance;

    /**
     * Specifies whether the call is a audio or a video call
     * 
     * @return   LiveChatAvCallTypes   The call type
     */
    this_.type = function () { return LiveChatAvCallTypes.AUDIO; }

    /**
     * Returns a unique identifier that identifies the call
     * 
     * @return   string   The call ID
     */
    this_.callId = function () { return undefined; }

    /**
     * Downgrades a video call to audio call. This will have no effect on a audio call.
     */
    this_.downgrade = function () { }

    /**
     * This method should be called to accept the call. If neither accept() not reject() is called
     * after a specific time (2mins), the call will automatically be rejected and any further calls
     * will have no effect. Once accepted or rejected any further calls will have no effect.
     * 
     * @return   Boolean   Returns true if the function was successful. Only the first function call 
     *  may return true. any subsequent calls will return false indicating failure.
     */
    this_.accept = function () { return false; }

    /**
     * This method should be called to reject the call. Refer to accept() method for details.
     * 
     * @return   Boolean   Returns true of function was successful. Only the first function call
     *  may return true. any subsequent calls will return false indicating failure.
     */
    this_.reject = function () { return false; }
}

/**
 * The LiveChat Audio/Video interface represents the API to be used by applications for seting
 * up audio/video calls. The LiveChat instance should be properly initialized first to use this
 * interface.
 * 
 * @class LiveChatAvInterface
 */
function LiveChatAvInterface(instance) {
	var this_ = instance;
	
	/**
	 * The user should call this method to set the configurations prior to using any other function
	 * of this class. This initializes the configurations to setup the audio/video session.
	 * 
	 * @param   Object   config   A Object that contains following parameters
	 *     var config = {
	 *         MediaTransport : {
	 *             // Refer to https://www.w3.org/TR/webrtc/#dom-rtcconfiguration for all values 
	 *             // supported by this section and detailed meaning.
	 *             iceServers : [
	 *                 {urls: 'turn:turn2.l.google.com:19303', credential: 'test', username: 'test'},
	 *                 {urls: 'stun:stun2.l.google.com:19302'}
	 *             ],
	 *             iceTransportPolicy : "relay",
	 *         },
	 *         MediaCapture : {
	 *             audio: {
	 *                 // Refer to https://www.w3.org/TR/mediacapture-streams/#dom-mediatrackconstraintset
	 *                 // for all values supported by this section and detailed meaning.
	 *                 enabled : true,
	 *                 autoGainControl : true,
	 *                 noiseSuppression : true,
	 *                 echoCancellation : true
	 *             },
	 *             video: {
	 *                 // Refer to https://www.w3.org/TR/mediacapture-streams/#dom-mediatrackconstraintset
	 *                 // for all values supported by this section and detailed meaning.
     *                 enabled : true,
	 *                 width : 640,
	 *                 height : 480,
	 *                 frameRate : 30.0,
	 *                 deviceId : "IntegratedWebCam_1"
	 *             }
	 *         },
	 *         Signaling : {
	 *             // Refer to https://www.w3.org/TR/webrtc/#dom-rtcofferoptions for all values
	 *             // supported by this section and detailed meaning.
	 *             iceRestart : true
	 *         },
	 *         Network : {
	 *             Bandwidth : {
	 *                 // The max kbps for a single audio track (integer between 6 - 64)
	 *                 SingleAudioTrackLimit : 8,
	 *
	 *                 // The max kbps for a single video track (integer between 128 - 2048)
	 *                 SingleVideoTrackLimit : 128,
	 *
	 *                 // The max kbps for all video and audio tracks (integer)
	 *                 CumelativeSessionLimit : 2048
	 *             },
     *             CdcAutoSelection : false
	 *         },
	 *         Display : {
	 *             // Triggered when call is connected
	 *             // Both variables remoteStreams and localStream are Arrays of MediaStream objects
     *             // remoteUserInfo - map streamId -> { userId, streamType, ... }
	 *             OnConnected : function(remoteStreams, localStreams, remoteUserInfo, callId),
	 *
	 *             // Triggered when call is ended
     *             // 0 - hangup, 1 - connection_error, 2 - call_disconnect
	 *             OnDisconnected : function(reasonCode, callId),
	 *
     *             // Triggered when call put on hold/unhold by this end
	 *             OnLocalHold : function(callId),
     *             OnLocalUnhold : function(callId),
     *             
     *             // Triggered when call put on hold/unhold by remote end
     *             OnRemoteHold : function(callId),
     *             OnRemoteUnhold : function(callId),
     *             
	 *             // Triggered when a error occurs causing the call to fail. The errorCode may be 
	 *             // one of the LiveChatAvErrorCodes
     *             // add calee_offline, call_not_answered, rejected, canceled to LiveChatAvErrorCodes
     *             // For some cases (when no response from other side) the returned callId may be null
	 *             OnFail : function(errorCode, callId),
     *             
     *             OnRemoteRinging : function(userId, callId),
     *             
     *             // acceptObject is a LiveChatAvAcceptInterface instance that user can use to 
     *             // accept/reject a call.
     *             OnIncomingCall : function(userIds, acceptObject, callId),
     *             
     *             OnUserJoining : function(userId, callId),
     *             OnUserLeft : function(userId, reason, callId),
     *             OnStreamsChanged : function(remoteStreams, localStreams, remoteUserInfo, callId),
     *             
     *             OnSignalStrengthChange : function(strength, callId),
     *             
     *             // evData - { event: name, callId: id, data: { ... } }
     *             OnEvent : function(evData)
     *             
	 *             // deprecated: Triggered when call is put on hold by the remote end
	 *             OnHold : function(),
	 *
	 *             // deprecated: Triggered when previously hold call is put on unhold by the remote end
	 *             OnUnhold : function(),
	 * 
	 * 			   // Triggered when a user shares their screen
	 * 			   // Both variables remoteStreams and localStream are Arrays of MediaStream objects
     *             // remoteUserInfo - map streamId -> { userId, streamType, ... }
	 * 			   OnScreenshareConnected: function(remoteStreams, remoteUserInfo, callId),
	 * 
	 * 			   // Triggered when the screenshare is ended
	 * 			   // 0 - screenshare-disconnected-locally, 1 - connection_error, 2 - screenshare_disonnected_remotely
	 * 			   OnScreenshareDisconnected: function(),
	 * 
	 * 			   //Triggered when a user is speaking
	 * 			   //userId Id of the user who is speaking
	 * 			   OnVoiceActivity: function(userId)
	 *         },
	 * 		   VoiceActivity: {
     *             AudioLevelCheckEnabled: true,
     *             AudioVideoLevelThreshold: 0.31
     *         }
	 *     }
	 */
	this_.SetAvConfigs = function(config) {	}

	/**
	 * Call this method to start a Call. The SetAvConfigs method should be called at least once for
	 * this instance prior to call to this method. When call is established the callbacks (specified
	 * in the config object of SetAvConfigs call) will be triggered accordingly.
	 * 
	 * @param   string   sid   A unique ID for this call for logging purposes
     * @param   string   uid   The destination user id to call to
     * @param   LiveChatAvCallTypes   type   The call type. If this parameter is undefined, the call
     *  will be made as per configuration given to SetAvConfigs method.
	 */
	this_.StartAvCall = function(sid, uid, type) {	}

	/**
	 * Call this method to end a Call.
	 */
	this_.EndAvCall = function() { }

    /**
     * Call this method to retrieve the local video that would be sent to other side once a call is 
     * started. The audio/video parameters (in MediaCapture section) given to SetAvConfigs at the time of this 
     * call would be used for local audio/video capturing. Any changes to the audio/video parameters done
     * after this call will be disregarded.
     * 
     * Once user is done with the returned Promise or the stream it resolves to, user must call ReleaseLocalVideo
     * method to release the video resources.
     * 
     * @return   Promise   A promise object that will eventually resolve to a MediaStream will be given out.
     */
    this_.GetLocalVideo = function () { }

    /**
     * Releases the video stream retried by a call to GetLocalVideo.
     * @param   Promise/MediaStream   The promise object returned by GetLocalVideo call or the MediaStream 
     *  object that it resolves to.
     *  
     *  User must not call MediaStreamTrack.stop method if ReleaseLocalVideo is called. It is recommended
     *  for the user to call ReleaseLocalVideo instead of MediaStreamTrack.stop for the MediaStream object
     *  relieved by a call to GetLocalVideo.
     *  
     *  This call is equivalent to calling MediaStreamTrack.stop of each track of the stream.
     */
    this_.ReleaseLocalVideo = function (stream) { }

	/**
	 * Call this method to mute audio/video as required.
	 *
	 * @param   Boolean   audio   If set mute microphone, unmute otherwise.
	 *
	 * @param   Boolean   video   If set pause camera capture, resume otherwise.
	 */
    this_.Pause = function (audio, video) { }

    /**
     * Call this method to hold the call
     * 
     * @param   Boolean   hold   Hold the call when set to true, Otherwise resume call.
     */
	this_.Hold = function (hold) { }
	
	/**
	 * Call this method to start screensharing. This method can be called only after a audio/video call is established.
	 *  
	 * @param   string   sid   A unique ID for this call for logging purposes
	 */
	this_.StartScreensharing = function (sid) { }

	/**
	 * Call this method to end screensharing.
	 */
	this_.StopScreensharing = function () { }

    /**
     * Adds users to the call as a conference. If the call was point to point, it will be elevated
     * automatically to a conference call.
     * 
     * @param   string   uid   The new user ID to be conferenced to the call
     */
    this_.Conference = function (uid) { }

    /**
     * Specifies whether the call is a audio or a video call
     * 
     * @return   LiveChatAvCallTypes/undefined   The call type or 'undefined' if no call is active
     */
    this_.getType = function () { return; }

    /**
     * Add video to a audio call. If the call is a video call, this function will have no effect
     */
    this_.upgradeToVideo = function () { }
}

/**
 * The messaging interface for livechat-video SDK. The following interface must be implemented
 * with any technology that allows to send and receive-messages. The channel must have
 * bellow properties for proper functionality.
 * 1. Must ensure guaranteed delivery of a message within a reasonable time frame, given that 
 *    the next message is also delivered. For example, in a message sequence [A, B, C, D] if 
 *    message D is delivered to the other end, the channel must also ensure messages delivery  
 *    of messages A, B, C. In other words, a message may not be delivered if and only if all 
 *    subsequent messages are also not delivered.
 * 2. Must ensure message integrity. In other words, the content of the message being sent 
 *    must not be altered in any way during transition.
 * 3. Must maintain message sequence. In other words, the messages handed over to the channel 
 *    must be handed over to the other end in the same sequence. For example, in a message 
 *    sequence [A, B, C, D] handed over to the channel must be delivered (if ever delivered)
 *    in the same [A, B, C, D] sequence.
 * 4. Must maintain authenticity, confidentiality and non-repudability of the messages. This 
 *    requirement is optional and may be omitted if relevant security concerns are agreed upon.
 */
function LiveChatAvCommInterface(instance) {
    var this_ = instance;

    /**
     * The channel should implement this method to give the user identifier to be presented
     * to the other side when making a call. User information is not sent when this method 
     * is not overridden or this method returns a null value.
     * 
     * @return   string   A alphanumeric user ID that represents this party to the other end
     */
    this_.getUserId = function () { return ""; }

	/**
	 * The channel should trigger this callback to handover a message 'coming from the 
	 * other end' to the library. The handed over messages must adhere to the above 
	 * mensioned channel properties.
	 *
	 * @param   string   msg   The message string sent from the other end.
	 */
    this_.onVideoMessage = function (msg) { }


	/**
	 * The channel should implement this method to deliver the given string message to 
	 * then other end. The message delivery must adhere to the above mentioned channel 
	 * properties.
	 *
	 * @param   string   msg   The message string to be sent to the other end.
     * @param   string   to    The destination party ID
	 */
    this_.SendAppMessage = function (msg, to) { }


	/**
	 * The channel should implement this method to log the given content at server side.
	 * The ordering of the logs must be in the same sequence this function is called by the SDK.
	 * These logs are mandatory for troubleshooting issues.
	 *
	 * @param   string   type   The log type (e.g. info, warning...etc).
	 * @param   string   unit   The unit/class/component that produced the log.
	 * @param   string   msg    The log string.
	 */
    this_.slog = function (type, unit, msg) { }
}

/**
 * Provides functionality to instantiate objects that implement LiveChatAvInterface
 */
function LiveChatAvFactory() {
    var this_ = this;

    /**
     * Creates a object that provides LiveChatAvInterface using the given comm instance
     * 
     * @param   LiveChatAvCommInterface   comm   The underlying communication interface
     * @return   LiveChatAvInterface   Returns a livechat instance
     */
    this_.CreateUsingCustom = function (comm) { return null; }

    /**
     * Creates a object that provides LiveChatAvInterface using Livechat-http communication
     * interface.
     */
    this_.CreateUsingLivechat = function () { return null; }

    /**
     * Creates a object that provides LiveChatAvInterface using Livechat2 communication 
     * interface.
     * 
     * @param   Object   livechat2Instance   The livechat2 object instance. Please refer to 
     *  livechat2 API reference on how to instantiate this. Also the livechat2 instance should 
     *  be a valid logged in instance.
     */
    this_.CreateUsingLivechat2 = function (livechat2Instance) { return null; }

    /**
     * This is a internal function call and user should not modify/change this code.
     */
    LiveChatAvFactoryImpl(this_);
}

/**
 * The sample video display class. This shows the local video captured and the video streams 
 * recieved from the other end in a user friendly layout.
 *
 * This layout cass only provides minimal capabilities and is ment only for demonstration 
 * purposes. The application developer can create their own video display as required taking
 * this class as a sample/template.
 * 
 * This class does not provide any public functions for application to call except for destroy() 
 * method. When OnConnected callback of LiveChatAvInterface is triggered, just create a new 
 * instance of this class with following arguments and the video will be displayed on the 
 * provided div. When OnDisconnected callback of LiveChatAvInterface is triggered, just call the
 * destroy() method and the video display will be removed.
 *
 * @param   DOM Element   container   A HTML DIV Element object for the controller to be drawn
 *  The provided DIV element is expected to be of size 640 x 480 or larger. The size of the 
 *  provided element should be set explicitly and should not expected to be auto sized depending
 *  on it's contents. 
 *
 * @param   Array   localStreams   A Array of MediaStream objects provided by LiveChatAvInterface
 *  when a call is connected.
 *
 * @param   Array   remoteStreams   A Array of MediaStream objects provided by LiveChatAvInterface
 *  when a call is connected.
 *
 * @class VideoCallLayout
 */
function VideoCallLayout(container, localStreams, remoteStreams) {
	/**
	 * The default style sheet for the VideoCallLayout. 
	 * Developer should add this to the web page.
		<style>
			// The main video pannel
			.tlcv-main-video {
				width: 100%;
				height: 100%;
				position : relative;
				overflow : hidden;
				border-radius: 5px;
				background : black;
				border : 2px solid black;
				z-index : 1;
			}

			// The small video container strip
			.tlcv-small-video-pannel {
				width : 125%;
				height : calc(25% + 4px);
				position : absolute;
				bottom : 2px;
				right : 2px;
				overflow : hidden;
				z-index : 2;
			}

			// A small video pannel
			.tlcv-small-video {
				width : 20%;
				height : calc(100% - 4px);
				float : right;
				background : black;
				border-radius: 5px;
				border : 2px solid black;
				z-index : 3;
			}

			// Small video pannel selection heighlight
			.tlcv-small-video:hover {
				background : grey;
				border : 2px dashed silver;
			}
			
			// A HTML video element
			.tlcv-video-element {
				width : 100%;
				height : 100%;
				border-radius: 5px;
			}
		</style>
	 *
	 */
	
	var this_ = this;
	
	/**
	 * This function should be called by application to hide/cleanup the video display
	 */
	this_.destroy = function() {
		var pe = this_.mainLayoutElem_.parentElement;
		pe.removeChild(this_.mainLayoutElem_);
		
		this_.mainLayoutElem_ = null;
		this_.smallLayoutElem_ = null;
		
		this_.smallVideoElements_ = null;
		
		for (var i = 0; i < this_.streams_.length; i++) {
			var v = this_.streams_[i];
			v.pause();
			v.srcObject = undefined;
		}
		
		this_.streams_ = [];
		this_.mainStream_ = 0;
	}
	
	this_.mainLayoutElem_ = null;
	this_.smallLayoutElem_ = null;
	
	this_.smallVideoElements_ = null;
	
	this_.streams_ = [];
	this_.mainStream_ = 0;
	
	this_._init = function(c, lss, rss) {
		var doc = c.ownerDocument;
		
		// create main video pannel
		this_.mainLayoutElem_ = doc.createElement("div");
		this_.mainLayoutElem_.className = "tlcv-main-video";
		c.appendChild(this_.mainLayoutElem_);
		
		// create small video pannel
		this_.smallLayoutElem_ = doc.createElement("div");
		this_.smallLayoutElem_.className = "tlcv-small-video-pannel";
		this_.mainLayoutElem_.appendChild(this_.smallLayoutElem_);
		this_.smallLayoutElem_.onclick = function(event) {
			if (event.target != undefined && event.target.tagName.toLowerCase() == "video" &&
				event.target.tlcvIndex_ != undefined) {
				this_._onReorderVideo(event.target.tlcvIndex_);
			}
		}
		
		// re-arrange and create streams list
		if (rss.length > 0) {
			this_.streams_.push(rss[0]);
			rss.splice(0, 1);
		}
		
		if (lss.length > 0) {
			for (var i = 0; i < lss.length; i++) {
				lss[i].isLocal_ = true;
			}
			
			this_.streams_ = this_.streams_.concat(lss);
		}
		
		if (rss.length > 0) {
			this_.streams_ = this_.streams_.concat(rss);
		}
		
		// create hidden video elements (so that sound is heard from all) 
		for (var i = 0; i < this_.streams_.length; i++) {
			var s = this_.streams_[i];
			
			var v = doc.createElement("video");
			v.className = "tlcv-video-element";
			v.autoplay = true;
			v.style.visibility = "hidden";
			v.srcObject = s;
			v.tlcvIndex_ = i;
			v.isLocal_ = (s.isLocal_ == true);
			
			if (v.isLocal_) {
				// local video sound should neo be played back
				v.muted = true;
			}
			
			this_.streams_[i] = v;
		}
		
		// create 5 small pannels to hols visible video elements
		this_.smallVideoElements_ = [];
		for (var i = 0; i < 5; i++) {
			var e = doc.createElement("div");
			e.className = "tlcv-small-video";
			e.style.visibility = "hidden";
			this_.smallLayoutElem_.appendChild(e);			
			this_.smallVideoElements_.push(e);
		}
		
		// display video
		this_._onReorderVideo(0);
	}
	
	this_._onReorderVideo = function(index) {
		if (this_.streams_.length <= index)
			return;

		var containers = {};
		
		// find containers
		for (var i = 0; i < this_.streams_.length; i++) {
			var stream = this_.streams_[i];
			var pe = stream.parentElement;
			
			if (pe == null) {
				continue;
			} else if (pe === this_.mainLayoutElem_) {
				containers["main"] = i;
			} else {
				for (var j = 0; i < this_.smallVideoElements_.length; i++) {
					if (pe === this_.smallVideoElements_[j]) {
						containers["small" + j] = i;
					}
				}
			}
		}
		
		// re-attach to proper div. hide unused video elements
		var smallIdx = 0;
		for (var i = 0; i < this_.streams_.length; i++) {
			var ctrElem = undefined;
			var mapKey = undefined;
			var newElem = this_.streams_[i];
			
			if (i == index) {
				mapKey = "main";
				ctrElem = this_.mainLayoutElem_;
			} else if (smallIdx < this_.smallVideoElements_.length) {
				mapKey = "small" + smallIdx;
				ctrElem = this_.smallVideoElements_[smallIdx];
				smallIdx++;
			} else {
				var pe = newElem.parentElement;
				if (pe != null) {
					pe.removeChild(newElem);
				}
				
				newElem.style.visibility = "hidden";
			}
			
			if (ctrElem != undefined) {
                var curElemIdx = containers[mapKey];
                var curElem = this_.streams_[curElemIdx];

				if (curElem == undefined) {
					ctrElem.appendChild(newElem);
				} else {
					ctrElem.replaceChild(newElem, curElem);
				}
				
				ctrElem.style.visibility = "visible";
				newElem.style.visibility = "visible";
			}
		}
		
		// hide unused divs
		for (var i = smallIdx; i < this_.smallVideoElements_.length; i++) {
			this_.smallVideoElements_[smallIdx].style.visibility = "hidden";
		}
		
		this_.mainStream_ = index;
	}
	
	this_._init(container, localStreams, remoteStreams);
}



